import{_ as e,c as o,o as a,ag as r}from"./chunks/framework.CxQVUucW.js";const g=JSON.parse('{"title":"Glossary","description":"","frontmatter":{},"headers":[],"relativePath":"glossary.md","filePath":"glossary.md","lastUpdated":null}'),n={name:"glossary.md"};function s(i,t,d,l,c,h){return a(),o("div",null,[...t[0]||(t[0]=[r('<h1 id="glossary" tabindex="-1">Glossary <a class="header-anchor" href="#glossary" aria-label="Permalink to &quot;Glossary&quot;">​</a></h1><p>Definitions of key terms used in PAW Blockchain.</p><h2 id="a" tabindex="-1">A <a class="header-anchor" href="#a" aria-label="Permalink to &quot;A&quot;">​</a></h2><p><strong>Address</strong> A unique identifier (starting with &quot;paw&quot;) that represents an account on PAW Blockchain. Example: <code>paw1xxxxxxxxxxxxxxxxxxxxxxxxxx</code></p><p><strong>AMM (Automated Market Maker)</strong> A decentralized exchange protocol that uses liquidity pools and mathematical formulas to price assets, rather than traditional order books.</p><p><strong>APR (Annual Percentage Rate)</strong> The yearly rate of return on staked tokens, not accounting for compounding.</p><p><strong>APY (Annual Percentage Yield)</strong> The yearly rate of return on staked tokens, including compounding effects.</p><h2 id="b" tabindex="-1">B <a class="header-anchor" href="#b" aria-label="Permalink to &quot;B&quot;">​</a></h2><p><strong>BFT (Byzantine Fault Tolerance)</strong> The ability of a distributed system to reach consensus even when some nodes are unreliable or malicious.</p><p><strong>Block</strong> A collection of transactions bundled together and added to the blockchain every 4 seconds on PAW.</p><p><strong>Block Height</strong> The sequential number of a block in the blockchain. Genesis block = height 0.</p><p><strong>Block Proposer</strong> The validator selected to create the next block in the blockchain.</p><h2 id="c" tabindex="-1">C <a class="header-anchor" href="#c" aria-label="Permalink to &quot;C&quot;">​</a></h2><p><strong>Chain ID</strong> Unique identifier for a blockchain network. PAW mainnet: <code>paw-mainnet-1</code>, testnet: <code>paw-testnet-1</code></p><p><strong>Commission</strong> The percentage fee validators charge delegators for staking services. Typical: 5-10%.</p><p><strong>Consensus</strong> The process by which validators agree on the next block to add to the blockchain.</p><p><strong>Cosmos SDK</strong> The modular framework used to build PAW Blockchain, enabling custom modules and IBC compatibility.</p><h2 id="d" tabindex="-1">D <a class="header-anchor" href="#d" aria-label="Permalink to &quot;D&quot;">​</a></h2><p><strong>Delegator</strong> A token holder who stakes PAW tokens with a validator to earn rewards.</p><p><strong>DEX (Decentralized Exchange)</strong> A peer-to-peer marketplace where users can trade cryptocurrencies without intermediaries. PAW has a built-in DEX.</p><p><strong>Double Signing</strong> When a validator signs two different blocks at the same height. Results in 5% slash penalty.</p><p><strong>DPoS (Delegated Proof of Stake)</strong> A consensus mechanism where token holders vote for validators to secure the network.</p><h2 id="f" tabindex="-1">F <a class="header-anchor" href="#f" aria-label="Permalink to &quot;F&quot;">​</a></h2><p><strong>Fees</strong> The cost to process transactions on PAW, paid in PAW tokens. Typical fee: ~0.001 PAW.</p><p><strong>Finality</strong> The point at which a transaction cannot be reversed. On PAW: 1 block (4 seconds).</p><h2 id="g" tabindex="-1">G <a class="header-anchor" href="#g" aria-label="Permalink to &quot;G&quot;">​</a></h2><p><strong>Gas</strong> A measure of computational effort required to execute a transaction. Higher complexity = more gas.</p><p><strong>Genesis</strong> The first block of a blockchain (block height 0) containing initial state and parameters.</p><p><strong>Governance</strong> The process by which PAW token holders vote on network changes and proposals.</p><h2 id="i" tabindex="-1">I <a class="header-anchor" href="#i" aria-label="Permalink to &quot;I&quot;">​</a></h2><p><strong>IBC (Inter-Blockchain Communication)</strong> A protocol enabling different blockchains to transfer assets and data between each other.</p><p><strong>Impermanent Loss</strong> Temporary loss of funds when providing liquidity to an AMM pool, compared to simply holding the tokens.</p><h2 id="j" tabindex="-1">J <a class="header-anchor" href="#j" aria-label="Permalink to &quot;J&quot;">​</a></h2><p><strong>Jailed</strong> Status of a validator that has been penalized for misbehavior and temporarily removed from the active set.</p><h2 id="l" tabindex="-1">L <a class="header-anchor" href="#l" aria-label="Permalink to &quot;L&quot;">​</a></h2><p><strong>Liquidity Pool</strong> A collection of tokens locked in a smart contract, used to facilitate trading on a DEX.</p><p><strong>LP Tokens (Liquidity Provider Tokens)</strong> Tokens received when providing liquidity to a pool, representing your share of the pool.</p><h2 id="m" tabindex="-1">M <a class="header-anchor" href="#m" aria-label="Permalink to &quot;M&quot;">​</a></h2><p><strong>Mainnet</strong> The primary, production blockchain network where real transactions occur (vs. testnet).</p><p><strong>Mnemonic</strong> A 24-word phrase used to recover a wallet. Also called &quot;seed phrase&quot; or &quot;recovery phrase&quot;.</p><p><strong>Mempool</strong> The waiting area for unconfirmed transactions before they&#39;re included in a block.</p><p><strong>Module</strong> A self-contained piece of functionality in Cosmos SDK. PAW has modules for bank, staking, DEX, etc.</p><h2 id="n" tabindex="-1">N <a class="header-anchor" href="#n" aria-label="Permalink to &quot;N&quot;">​</a></h2><p><strong>Node</strong> A computer running PAW blockchain software, maintaining a copy of the blockchain.</p><p><strong>NoWithVeto</strong> A strong rejection vote used in governance for spam or malicious proposals.</p><h2 id="o" tabindex="-1">O <a class="header-anchor" href="#o" aria-label="Permalink to &quot;O&quot;">​</a></h2><p><strong>Oracle</strong> A service that provides external data (like prices) to the blockchain. PAW has a decentralized oracle module.</p><h2 id="p" tabindex="-1">P <a class="header-anchor" href="#p" aria-label="Permalink to &quot;P&quot;">​</a></h2><p><strong>Proposal</strong> A formal suggestion for changing network parameters, submitted through governance.</p><p><strong>Pruning</strong> The process of deleting old blockchain data to save disk space.</p><h2 id="q" tabindex="-1">Q <a class="header-anchor" href="#q" aria-label="Permalink to &quot;Q&quot;">​</a></h2><p><strong>Quorum</strong> The minimum participation rate required for a governance vote to be valid. PAW: 40%.</p><h2 id="r" tabindex="-1">R <a class="header-anchor" href="#r" aria-label="Permalink to &quot;R&quot;">​</a></h2><p><strong>Redelegate</strong> Moving staked tokens from one validator to another without unbonding period.</p><p><strong>RPC (Remote Procedure Call)</strong> An interface for interacting with the blockchain programmatically.</p><h2 id="s" tabindex="-1">S <a class="header-anchor" href="#s" aria-label="Permalink to &quot;S&quot;">​</a></h2><p><strong>Seed Node</strong> A node that helps new nodes find peers when joining the network.</p><p><strong>Sentry Node</strong> A node that sits between validators and the public internet, protecting validators from DDoS attacks.</p><p><strong>Slashing</strong> Penalty imposed on validators (and their delegators) for misbehavior like double-signing or downtime.</p><p><strong>Slippage</strong> The difference between expected and actual transaction price, common in DEX trades.</p><p><strong>Staking</strong> Locking tokens to support network security and earn rewards.</p><p><strong>State Sync</strong> A fast synchronization method that downloads a recent state snapshot instead of all historical blocks.</p><h2 id="t" tabindex="-1">T <a class="header-anchor" href="#t" aria-label="Permalink to &quot;T&quot;">​</a></h2><p><strong>TEE (Trusted Execution Environment)</strong> Secure area of a processor that protects code and data. Used in PAW&#39;s compute module.</p><p><strong>Tendermint</strong> The BFT consensus engine that powers PAW Blockchain.</p><p><strong>Testnet</strong> A test blockchain network for development and testing, using test tokens with no real value.</p><p><strong>Transaction (TX)</strong> An operation that changes the blockchain state, like sending tokens or voting.</p><p><strong>TWAP (Time-Weighted Average Price)</strong> An average price calculated over a specific time period, used to prevent price manipulation.</p><h2 id="u" tabindex="-1">U <a class="header-anchor" href="#u" aria-label="Permalink to &quot;U&quot;">​</a></h2><p><strong>Unbonding</strong> The 21-day process of unstaking tokens, during which they earn no rewards.</p><p><strong>Uptime</strong> The percentage of time a validator has been online and signing blocks.</p><h2 id="v" tabindex="-1">V <a class="header-anchor" href="#v" aria-label="Permalink to &quot;V&quot;">​</a></h2><p><strong>Validator</strong> A node operator responsible for proposing and validating blocks in exchange for rewards.</p><p><strong>Voting Period</strong> The 14-day window during which stakers can vote on a governance proposal.</p><p><strong>Voting Power</strong> A validator&#39;s influence in consensus, proportional to their total stake (self + delegations).</p><h2 id="w" tabindex="-1">W <a class="header-anchor" href="#w" aria-label="Permalink to &quot;W&quot;">​</a></h2><p><strong>Wallet</strong> Software that stores private keys and allows users to manage their PAW tokens.</p><p><strong>WebSocket</strong> A protocol for real-time, bi-directional communication, used for live blockchain data.</p><h2 id="common-abbreviations" tabindex="-1">Common Abbreviations <a class="header-anchor" href="#common-abbreviations" aria-label="Permalink to &quot;Common Abbreviations&quot;">​</a></h2><table tabindex="0"><thead><tr><th>Abbreviation</th><th>Full Term</th></tr></thead><tbody><tr><td>AMM</td><td>Automated Market Maker</td></tr><tr><td>APR</td><td>Annual Percentage Rate</td></tr><tr><td>APY</td><td>Annual Percentage Yield</td></tr><tr><td>BFT</td><td>Byzantine Fault Tolerance</td></tr><tr><td>CEX</td><td>Centralized Exchange</td></tr><tr><td>CLI</td><td>Command Line Interface</td></tr><tr><td>DAO</td><td>Decentralized Autonomous Organization</td></tr><tr><td>DEX</td><td>Decentralized Exchange</td></tr><tr><td>DPoS</td><td>Delegated Proof of Stake</td></tr><tr><td>IBC</td><td>Inter-Blockchain Communication</td></tr><tr><td>LP</td><td>Liquidity Provider</td></tr><tr><td>RPC</td><td>Remote Procedure Call</td></tr><tr><td>SDK</td><td>Software Development Kit</td></tr><tr><td>TEE</td><td>Trusted Execution Environment</td></tr><tr><td>TX</td><td>Transaction</td></tr><tr><td>TWAP</td><td>Time-Weighted Average Price</td></tr></tbody></table><hr><p><strong>Still confused?</strong> Check the <a href="/docs/faq.html">FAQ</a> or ask in <a href="https://discord.gg/pawblockchain" target="_blank" rel="noreferrer">Discord</a></p>',82)])])}const u=e(n,[["render",s]]);export{g as __pageData,u as default};
